Account_Record_Views_1.query:
q = load "LightningPageViewWithUserEA";
Account_IDsandNames = load "Account_IDsandNames";
q = filter q by date('TIMESTAMP_DERIVED_Year', 'TIMESTAMP_DERIVED_Month', 'TIMESTAMP_DERIVED_Day') in {{column(static_1.selection, ["Text3"]).asObject()}};
q = filter q by 'PAGE_URL' matches "/lightning/r/Account/001";
q = filter q by !('PAGE_URL' like "%related%");
q = filter q by 'PAGE_URL' matches "/view";
q = group q by 'PAGE_URL';
q = foreach q generate q.'PAGE_URL' as 'pageUrl', substr(trim(q.'PAGE_URL',"/lightning/r/Account/"),1,18) as 'Id',count(q) as 'Count';
q = group q by 'pageUrl';
q2 = load "Account_IDsandNames";
q2 = group q2 by 'Name';
results = cogroup q by 'Id', q2 by 'Id';
--results = join q by ('Id') semi, q2 by ('Id');
results = foreach results generate q2.'Name' as 'Account Name', q.'pageUrl' as 'pageUrl', sum(q.'Count') as 'Count';
results = order results by 'Count' desc;
results = limit results 2000;

